    <div class="container">
        <div class="row justify-content-center">
            <div class="col-md-12 col-lg-9"><p class="ff3" style="font-size:22px;"><strong>Scikit-learn</strong> (formerly <strong>scikits.learn</strong>) is a <a href="https://en.wikipedia.org/wiki/Free_software" target="_self">free software</a> <a href="https://en.wikipedia.org/wiki/Machine_learning" target="_self">machine learning</a> <a href="https://en.wikipedia.org/wiki/Library_(computing)" target="_self">library</a> for the <a href="https://en.wikipedia.org/wiki/Python_(programming_language)" target="_self">Python</a> programming language. It features various <a href="https://en.wikipedia.org/wiki/Statistical_classification" target="_self">classification</a>, <a href="https://en.wikipedia.org/wiki/Regression_analysis" target="_self">regression</a> and <a href="https://en.wikipedia.org/wiki/Cluster_analysis" target="_self">clustering</a> algorithms including <a href="https://en.wikipedia.org/wiki/Support_vector_machine" target="_self">support vector machines</a>, <a href="https://en.wikipedia.org/wiki/Random_forests" target="_self">random forests</a>, <a href="https://en.wikipedia.org/wiki/Gradient_boosting" target="_self">gradient boosting</a>, <a href="https://en.wikipedia.org/wiki/K-means_clustering" target="_self">k-means</a> and <a href="https://en.wikipedia.org/wiki/DBSCAN" target="_self">DBSCAN</a>, and is designed to interoperate with the Python numerical and scientific libraries <a href="https://en.wikipedia.org/wiki/NumPy" target="_self">NumPy</a> and <a href="https://en.wikipedia.org/wiki/SciPy" target="_self">SciPy</a>.</p></div></div></div></section><section data-bs-version="5.1" class="image3 cid-tt612oXwA9" id="image3-5" style="padding-top:0px; padding-bottom:0px; background-color: rgb(255, 255, 255);">
