            <div class="col-md-12 col-lg-9"><p class="ff3" style="font-size:22px;"><strong>matplotlib</strong> is a <a href="https://en.wikipedia.org/wiki/Plotter" target="_self">plotting</a> <a href="https://en.wikipedia.org/wiki/Library_(computer_science)" target="_self">library</a> for the <a href="https://en.wikipedia.org/wiki/Python_(programming_language)" target="_self">Python</a> programming language and its numerical mathematics extension <a href="https://en.wikipedia.org/wiki/NumPy" target="_self">NumPy</a>. It provides an <a href="https://en.wikipedia.org/wiki/Object-oriented_programming" target="_self">object-oriented</a> <a href="https://en.wikipedia.org/wiki/API" target="_self">API</a> for embedding plots into applications using general-purpose <a href="https://en.wikipedia.org/wiki/GUI_toolkit" target="_self">GUI toolkits</a> like <a href="https://en.wikipedia.org/wiki/Tkinter" target="_self">Tkinter</a>, <a href="https://en.wikipedia.org/wiki/WxPython" target="_self">wxPython</a>, <a href="https://en.wikipedia.org/wiki/Qt_(software)" target="_self">Qt</a>, or <a href="https://en.wikipedia.org/wiki/GTK%2B" target="_self">GTK+</a>. There is also a <a href="https://en.wikipedia.org/wiki/Procedural_programming" target="_self">procedural</a> “pylab” interface based on a <a href="https://en.wikipedia.org/wiki/State_machine" target="_self">state machine</a> (like <a href="https://en.wikipedia.org/wiki/OpenGL" target="_self">OpenGL</a>), designed to closely resemble that of <a href="https://en.wikipedia.org/wiki/MATLAB" target="_self">MATLAB</a>, though its use is discouraged.<a href="https://en.wikipedia.org/wiki/Matplotlib#cite_note-2" target="_self">[2]</a> <a href="https://en.wikipedia.org/wiki/SciPy" target="_self">SciPy</a> makes use of matplotlib.</p></div></div></div></section><section data-bs-version="5.1" class="content5 cid-tt5UseJ9wk" id="content5-4" style="padding-top:0px; padding-bottom:0px;background-color: rgb(255, 255, 255);">
    <div class="container">
        <div class="row justify-content-center">
            <div class="col-md-12 col-lg-9"><p class="ff3" style="font-size:22px;">pyplot is a matplotlib module which provides a MATLAB-like interface.<a href="https://en.wikipedia.org/wiki/Matplotlib#cite_note-6" target="_self">[6]</a> matplotlib is designed to be as usable as MATLAB, with the ability to use Python, with the advantage that it is free.</p></div></div></div></section><section data-bs-version="5.1" class="image3 cid-tt612oXwA9" id="image3-5" style="padding-top:0px; padding-bottom:0px; background-color: rgb(255, 255, 255);">
